import React from "react";
import './TinySignal.css'

function TinySignal() {
    return (
        <div>
        <div className="TinySignal1">
           Combusion Motor
        </div>
        <div className="TinySignal2">
        Mini Box
       </div>
       <div className="TinySignal3">
        Mini Box
       </div>
       </div>
    );
}
export default TinySignal;
